Main Strategy is to Normal Summon Oviraptor, then using Oviraptors eff to add Misc to your hand. Then discard Misc to make your Dinos unaffected for this Main Phase. Banish Misc to Special Summon Animadorned. Use Animas eff to destroy a Petit or a Babycera to add your copy of Double Evolution Pill.  THen use the effect of Baby to Special Summon any Dino (best is to use another Anima) Link Summon  Linkuriboh by using Anima. Link Summon Secure Gardna using Linkuriboh. Activate Double Evolution Pill and banish ANima and Linkuriboh to Special your Tyranno from Deck. If you have an Invocation and Aleister in your hand, you can use both to go with an Anima into Mechaba. If you have a Dogmatika Monster (at best an Ecclessia) Special Summon it after you Link Summoned and get yourself a Punishment. Set Punishment Pass

&nbsp;

&nbsp;

this is not a complete deck, I'm waiting for the new Lyrilusc cards, other then that, you have lyrilusc, tri-brigate stigma dogma all in one deck.

